import React from "react";

import "./FilterSlider.css";

const FilterSlider = (props) => {
  return (
    <div>
      <div>
        <label>{props.title}</label>
      </div>
      <div className="slider-container">
        <div className="value-container"><label>{props.min}</label></div>
        <input className="value-slider" type="range" min={props.min} max={props.max} step={props.step} />
        <div className="value-container"><label>{props.max}</label></div>
      </div>
    </div>
  );
};

export default FilterSlider;
